At first I imagined the pipeline operator to be the lowest precedence, but now that [the question has been raised](https://github.com/mindeavor/babel/commit/fc1a9821779379d82174079fdc3315136d1d9208#commitcomment-14933745), I'm wondering – should it instead have higher precedence?

```js
obj.x || defaults.x |> process
//
// With lowest precedence:
//    process(obj.x || defaults.x)
//
// With higher precedence:
//    obj.x || process(defaults.x)
//

arg |> m.f || m.g |> h
//
// With lowest precedence:
//    h( (m.f || m.g)(arg) )
//
// With higher precedence:
//    m.f(arg) || m.g()
//
```

